import React from "react";
import "./App.css";
// import { Button, InputField } from "./components/atoms";
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navbar from "./pages/Navbar";

import {
  Home,
  LoginPage,
  AfterLogin,
} from './pages';
import NoMatch from "./pages/NoMatch";

function App(){

return (
  <>
  <Navbar />
  <Router>
    <section className="App">
        <section className="content">
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/home">
            <Home />
          </Route>
          <Route path="/login">
            <LoginPage />
          </Route>
          <Route path="/loggedIn">
            <AfterLogin />
          </Route>
          <Route path="*">
            <NoMatch />
          </Route>
        </section>
    </section>
  </Router>
  </>
);
}

export default App;
